        <div className="col-lg-9 form bg-white shadow-lg rounded ">
          <div className="text-end mb-2">
            <Pdf targetRef={ref} filename="userprofile.pdf">
              {({ toPdf }) => (
                <button className="btn btn-info me-2" onClick={toPdf}>
                  Download Pdf
                </button>
              )}
            </Pdf>

            <ReactHTMLTableToExcel
              id="test-table-xls"
              className="btn btn-success"
              table="table-to-xls"
              filename="tablexls"
              sheet="tablexls"
              buttonText="Download as XLS"
            ></ReactHTMLTableToExcel>
          </div>
          <div ref={ref} className="mt-5">
            <h4 className="text-center text-primary mt-3">Profile Detail</h4>

            <div className="row mt-3">
              <table className="ms-5" id="table-to-xls">
                {alldata.map((user, index) => {
                  return (
                    <tbody className="mb-5" key={index}>
                      <tr className="text-primary mb-5">
                        <th>Profile ID : </th>
                        <td>
                          <b>{user.id}</b>
                        </td>
                      </tr>
                      <tr>
                        <th>First Name : </th>
                        <td>{user.firstname}</td>
                        <th>Last Name : </th>
                        <td>{user.lastname}</td>
                      </tr>
                      <tr>
                        <th>Email : </th>
                        <td>{user.emailId}</td>
                        <th>Mobile : </th>
                        <td>{user.mobileNo}</td>
                      </tr>
                      <tr>
                        <th>Address : </th>
                        <td>{user.fulladdress}</td>
                        <th>Pincode :</th>
                        <td>{user.pincode}</td>
                      </tr>
                      <tr>
                        <th>District : </th>
                        <td>{user.district}</td>
                        <th>State : </th>
                        <td>{user.state}</td>
                      </tr>
                      <hr></hr>
                    </tbody>
                  );
                })}
              </table>
            </div>
          </div>
        </div>
      </div>
      <ToastContainer />
      <Link to="/register">Go back</Link>
    </div>
  );
};

export default UserList2;
